import React, { useRef } from 'react';
import jsPDF from 'jspdf';
import html2canvas from 'html2canvas';

const Results = ({ answers, shuffledQuestions, onRetake }) => {
  const reportRef = useRef();

  // Categories matching the questions
  const categories = [
    'Cognitive Flexibility',
    'Metacognition', 
    'Working Memory',
    'Organization',
    'Emotional Regulation',
    'Inhibitory & Impulse Control',  
    'Task Initiation & Motivation',
    'Sustained Attention',
    'Time Management'
  ];

  // Calculate scores for each category using shuffled questions
  const calculateScores = () => {
    const scores = {};

    // Initialize scores for each category
    categories.forEach(category => {
      scores[category] = {
        answers: [],
        raw: 0,
        percentage: 50,
        questionsAnswered: 0
      };
    });

    // Debug logging
    console.log('=== SCORING DEBUG ===');
    console.log('Shuffled Questions Order:', shuffledQuestions.map(q => ({ id: q.id, category: q.category, text: q.text.substring(0, 50) + '...' })));
    console.log('Answers Array:', answers);

    // Group answers by category based on shuffled questions
    shuffledQuestions.forEach((question, index) => {
      if (answers[index] !== undefined) {
        const categoryName = question.category;
        const answerValue = answers[index];

        console.log(`Question ${index + 1}: "${question.text.substring(0, 30)}..." â†’ Category: ${categoryName} â†’ Answer: ${answerValue}`);

        if (scores[categoryName]) {
          scores[categoryName].answers.push(answerValue);
        }
      }
    });

    // Calculate final scores for each category
    Object.keys(scores).forEach(category => {
      const categoryAnswers = scores[category].answers;
      const rawScore = categoryAnswers.reduce((sum, answer) => sum + answer, 0);
      const percentage = Math.round(((rawScore + (categoryAnswers.length * 3)) / (categoryAnswers.length * 6)) * 100);

      console.log(`${category}: Answers [${categoryAnswers.join(', ')}] â†’ Raw: ${rawScore} â†’ Percentage: ${percentage}%`);

      scores[category] = {
        raw: rawScore,
        percentage: percentage,
        questionsAnswered: categoryAnswers.length
      };
    });

    console.log('Final Scores:', scores);
    console.log('=== END DEBUG ===');

    return scores;
  };

  const scores = calculateScores();

  // Get color category based on percentage
  const getColorCategory = (percentage) => {
    if (percentage >= 80) return 'excellent';
    if (percentage >= 60) return 'good';
    if (percentage >= 40) return 'need-attention';
    return 'need-improvement';
  };

  // Enhanced radar chart using SVG with scale labels
  const RadarChart = ({ scores }) => {
    const size = 400;
    const center = size / 2;
    const radius = size / 2 - 60;
    const categories = Object.keys(scores);
    const values = Object.values(scores).map(s => s.percentage);

    const angleStep = (2 * Math.PI) / categories.length;

    // Generate points for the data polygon
    const dataPoints = values.map((value, index) => {
      const angle = index * angleStep - Math.PI / 2; // Start from top
      const r = (value / 100) * radius;
      const x = center + r * Math.cos(angle);
      const y = center + r * Math.sin(angle);
      return `${x},${y}`;
    }).join(' ');

    // Generate points for the outer polygon (scale lines)
    const outerPoints = categories.map((_, index) => {
      const angle = index * angleStep - Math.PI / 2;
      const x = center + radius * Math.cos(angle);
      const y = center + radius * Math.sin(angle);
      return { x, y, angle, category: categories[index] };
    });

    // Scale levels and their labels - evenly spaced from -18 to +18
    const scaleRings = [
      { scale: 0.2, label: '-18' },
      { scale: 0.4, label: '-9' },
      { scale: 0.6, label: '0' },
      { scale: 0.8, label: '+9' },
      { scale: 1.0, label: '+18' }
    ];

    return (
      <div className="radar-chart-container">
        <svg width={size} height={size} style={{ overflow: 'visible' }}>
          {/* Background grid circles */}
          {scaleRings.map(({ scale }) => (
            <circle
              key={scale}
              cx={center}
              cy={center}
              r={radius * scale}
              fill="none"
              stroke="#e5e7eb"
              strokeWidth="1"
            />
          ))}

          {/* Grid lines from center to each point */}
          {outerPoints.map((point, index) => (
            <line
              key={index}
              x1={center}
              y1={center}
              x2={point.x}
              y2={point.y}
              stroke="#e5e7eb"
              strokeWidth="1"
            />
          ))}

          {/* Data polygon */}
          <polygon
            points={dataPoints}
            fill="rgba(53, 92, 125, 0.2)"
            stroke="#355c7d"
            strokeWidth="3"
          />

          {/* Data points */}
          {values.map((value, index) => {
            const angle = index * angleStep - Math.PI / 2;
            const r = (value / 100) * radius;
            const x = center + r * Math.cos(angle);
            const y = center + r * Math.sin(angle);
            return (
              <circle
                key={index}
                cx={x}
                cy={y}
                r="5"
                fill="#355c7d"
                stroke="white"
                strokeWidth="2"
              />
            );
          })}

          {/* Category labels */}
          {outerPoints.map((point, index) => {
            // Position labels outside the chart
            const labelDistance = radius + 35;
            const labelX = center + labelDistance * Math.cos(point.angle);
            const labelY = center + labelDistance * Math.sin(point.angle);

            return (
              <text
                key={index}
                x={labelX}
                y={labelY}
                textAnchor="middle"
                dominantBaseline="middle"
                fontSize="13"
                fill="#4b5563"
                style={{ fontWeight: '500' }}
                transform={`rotate(0 ${labelX} ${labelY})`}
              >
                <tspan x={labelX} dy="0">{point.category.split(' ')[0]}</tspan>
                {point.category.split(' ').length > 1 && (
                  <tspan x={labelX} dy="15">{point.category.split(' ').slice(1).join(' ')}</tspan>
                )}
              </text>
            );
          })}

          {/* Scale labels - positioned on top */}
          {scaleRings.map(({ scale, label }) => (
            <text
              key={`label-${scale}`}
              x={center}
              y={center - radius * scale - 5}
              textAnchor="middle"
              fontSize="10"
              fill="#9ca3af"
              fontWeight="500"
            >
              {label}
            </text>
          ))}
        </svg>
      </div>
    );
  };

  // Generate and download PDF report
  const downloadReport = async () => {
    const element = reportRef.current;
    const canvas = await html2canvas(element, {
      scale: 2,
      useCORS: true,
      allowTaint: true,
      backgroundColor: '#ffffff',
      width: element.scrollWidth,
      height: element.scrollHeight
    });

    const imgData = canvas.toDataURL('image/png', 1.0);
    const pdf = new jsPDF({
      orientation: 'portrait',
      unit: 'mm',
      format: 'a4'
    });

    const pdfWidth = pdf.internal.pageSize.getWidth();
    const pdfHeight = pdf.internal.pageSize.getHeight();
    const imgWidth = pdfWidth;
    const imgHeight = (canvas.height * pdfWidth) / canvas.width;
    let heightLeft = imgHeight;

    let position = 0;

    pdf.addImage(imgData, 'PNG', 0, position, imgWidth, imgHeight);
    heightLeft -= pdfHeight;

    while (heightLeft >= 0) {
      position = heightLeft - imgHeight;
      pdf.addPage();
      pdf.addImage(imgData, 'PNG', 0, position, imgWidth, imgHeight);
      heightLeft -= pdfHeight;
    }

    const today = new Date().toISOString().split('T')[0];
    pdf.save(`Neurish-EF-Report-${today}.pdf`);
  };

  return (
    <div className="container">
      <div className="card results-container">
        <h2>Your Neurish Profile</h2>
        <p style={{ fontSize: '24px', color: '#6b7280', marginBottom: '40px' }}>
          Find. Focus. Flourish.
        </p>

        <p style={{ marginBottom: '40px', color: '#4b5563', fontSize: '18px' }}>
          Here's your personalized executive functioning profile across nine key domains. 
          Each category is scored based on your responses to shuffled questions.
        </p>

        <div style={{ display: 'flex', gap: '20px', marginBottom: '40px', justifyContent: 'center' }}>
          <button 
            className="btn btn-primary" 
            onClick={downloadReport}
            style={{ display: 'flex', alignItems: 'center', gap: '8px' }}
          >
            ðŸ“„ Download Report
          </button>

          <button 
            className="btn btn-secondary" 
            onClick={onRetake}
          >
            ðŸ”„ Retake Assessment
          </button>
        </div>

                {/* Downloadable Report Content */}
        <div ref={reportRef} style={{ backgroundColor: 'white', padding: '30px', borderRadius: '12px', maxWidth: '210mm', margin: '0 auto' }}>
          {/* Report Header */}
          <div style={{ textAlign: 'center', marginBottom: '30px', borderBottom: '2px solid #e5e7eb', paddingBottom: '20px' }}>
            <h1 style={{ fontSize: '32px', fontWeight: '300', color: '#1f2937', marginBottom: '8px' }}>
              Neurish
            </h1>
            <p style={{ fontSize: '16px', color: '#6b7280', marginBottom: '16px' }}>
              Executive Functioning Assessment Report
            </p>
            <p style={{ fontSize: '12px', color: '#9ca3af' }}>
              Generated on {new Date().toLocaleDateString('en-US', { 
                year: 'numeric', 
                month: 'long', 
                day: 'numeric' 
              })}
            </p>
          </div>

          {/* Main Content Grid */}
          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '30px', marginBottom: '30px' }}>

            {/* Left Column - Radar Chart & About */}
            <div>
              {/* Radar Chart */}
              <div style={{ textAlign: 'center', marginBottom: '25px' }}>
                <h3 style={{ fontSize: '18px', fontWeight: '500', color: '#1f2937', marginBottom: '15px' }}>
                  Your Executive Functioning Profile
                </h3>
                <div style={{ transform: 'scale(0.85)', transformOrigin: 'center' }}>
                  <RadarChart scores={scores} />
                </div>
              </div>

              {/* About Section */}
              <div style={{ marginBottom: '25px' }}>
                <h3 style={{ fontSize: '16px', fontWeight: '500', color: '#1f2937', marginBottom: '12px' }}>
                  About Executive Functioning
                </h3>
                <p style={{ fontSize: '13px', lineHeight: '1.5', color: '#4b5563', marginBottom: '12px' }}>
                  Executive functioning refers to mental skills including working memory, flexible thinking, 
                  and self-control. These skills help us learn, work, and manage daily life.
                </p>
                <p style={{ fontSize: '13px', lineHeight: '1.5', color: '#4b5563' }}>
                  This assessment evaluated your self-perception across nine key domains using 
                  54 carefully crafted questions, providing insights into your cognitive strengths.
                </p>
              </div>

              {/* Score Legend */}
              <div>
                <h3 style={{ fontSize: '16px', fontWeight: '500', color: '#1f2937', marginBottom: '12px' }}>
                  Score Interpretation
                </h3>
                <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '8px' }}>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '11px' }}>
                    <div style={{ width: '12px', height: '12px', backgroundColor: '#10b981', borderRadius: '2px' }}></div>
                    <span><strong>Excellent (80%+)</strong></span>
                  </div>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '11px' }}>
                    <div style={{ width: '12px', height: '12px', backgroundColor: '#3b82f6', borderRadius: '2px' }}></div>
                    <span><strong>Good (60-80%)</strong></span>
                  </div>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '11px' }}>
                    <div style={{ width: '12px', height: '12px', backgroundColor: '#f59e0b', borderRadius: '2px' }}></div>
                    <span><strong>Need Attention (40-60%)</strong></span>
                  </div>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '8px', fontSize: '11px' }}>
                    <div style={{ width: '12px', height: '12px', backgroundColor: '#ef4444', borderRadius: '2px' }}></div>
                    <span><strong>Need Improvement (Below 40%)</strong></span>
                  </div>
                </div>
              </div>
            </div>

            {/* Right Column - Detailed Scores */}
            <div>
              <h3 style={{ fontSize: '18px', fontWeight: '500', color: '#1f2937', marginBottom: '15px' }}>
                Detailed Results by Domain
              </h3>
              <div style={{ display: 'grid', gap: '12px' }}>
                {Object.entries(scores).map(([category, data]) => (
                  <div 
                    key={category} 
                    className={`category-card ${getColorCategory(data.percentage)}`}
                    style={{ 
                      padding: '16px', 
                      borderRadius: '8px',
                      display: 'flex',
                      justifyContent: 'space-between',
                      alignItems: 'center',
                      minHeight: '50px'
                    }}
                  >
                    <div style={{ flex: 1 }}>
                      <h4 style={{ fontSize: '14px', fontWeight: '500', margin: '0 0 4px 0', color: '#1f2937' }}>
                        {category}
                      </h4>
                      <div style={{ fontSize: '11px', color: '#6b7280' }}>
                        Raw Score: {data.raw > 0 ? '+' : ''}{data.raw}/{data.questionsAnswered * 3}
                        {data.questionsAnswered < 6 && (
                          <span style={{ color: '#ef4444', marginLeft: '4px' }}>
                            ({data.questionsAnswered}/6 answered)
                          </span>
                        )}
                      </div>
                    </div>
                    <div style={{ 
                      fontSize: '24px', 
                      fontWeight: '600', 
                      color: '#374151',
                      minWidth: '60px',
                      textAlign: 'right'
                    }}>
                      {data.percentage}%
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>

          {/* Domain Explanations - Compact Grid */}
          <div style={{ marginBottom: '25px', pageBreakBefore: 'always' }}>
            <h3 style={{ fontSize: '16px', fontWeight: '500', color: '#1f2937', marginBottom: '15px' }}>
              Executive Functioning Domains Explained
            </h3>
            <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: '12px', fontSize: '12px' }}>
              {[
                { name: 'Working Memory', desc: 'Hold and manipulate information while completing tasks.' },
                { name: 'Cognitive Flexibility', desc: 'Switch between concepts, adapt to new situations creatively.' },
                { name: 'Inhibitory Control', desc: 'Resist impulses, think before acting, control behavior.' },
                { name: 'Organization', desc: 'Create systems for managing materials, information, and time.' },
                { name: 'Task Initiation', desc: 'Begin tasks independently and maintain motivation.' },
                { name: 'Sustained Attention', desc: 'Maintain focus on activities despite distractions.' },
                { name: 'Emotional Regulation', desc: 'Manage emotions and respond with emotional balance.' },
                { name: 'Metacognition', desc: 'Awareness of thinking processes and performance monitoring.' },
                { name: 'Time Management', desc: 'Estimate time, prioritize tasks, and meet deadlines.' }
              ].map((domain, index) => (
                <div key={index} style={{ padding: '12px', backgroundColor: '#f9fafb', borderRadius: '6px', borderLeft: '3px solid #355c7d' }}>
                  <h4 style={{ fontSize: '13px', fontWeight: '500', color: '#1f2937', marginBottom: '6px' }}>
                    {domain.name}
                  </h4>
                  <p style={{ fontSize: '11px', color: '#4b5563', lineHeight: '1.4', margin: 0 }}>
                    {domain.desc}
                  </p>
                </div>
              ))}
            </div>
          </div>

          {/* Key Insights */}
          <div style={{ backgroundColor: '#f9fafb', padding: '20px', borderRadius: '8px', marginBottom: '20px' }}>
            <h4 style={{ fontSize: '14px', fontWeight: '500', color: '#1f2937', marginBottom: '12px' }}>
              Understanding Your Results
            </h4>
            <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '16px', fontSize: '12px', color: '#4b5563', lineHeight: '1.5' }}>
              <div>
                <p style={{ margin: '0 0 8px 0' }}>
                  <strong>Excellent (80%+):</strong> Strong self-perceived skills in this domain
                </p>
                <p style={{ margin: '0' }}>
                  <strong>Good (60-80%):</strong> Function well with room for development
                </p>
              </div>
              <div>
                <p style={{ margin: '0 0 8px 0' }}>
                  <strong>Need Attention (40-60%):</strong> Could benefit from focused attention
